import styled from '@emotion/styled';


export const AuthNavCss = styled.ul`
    color: white;
    display: flex;
    gap: 20px;
    flex-direction: row-reverse;
    margin-bottom: 20px;
    padding-right: 30px;
    margin-left: 940px;
`;
